INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(24, 3, 'Diagrama de Classe', '', 'Diagrama de Classe\r\nOBJETIVO C\r\nEste diagrama de classe representa uma rede social, abrangendo usuários, administradores, publicações, comentários, notificações e\r\neventos. Destaques incluem a herança de propriedades de Usuario para Administrador, operações administrativas como bloquear e\r\nbanir usuários, relacionamentos entre usuários, eventos e publicações, e operações de usuário como adicionar amigos e criar\r\npublicações. O diagrama oferece uma visão abrangente da estrutura e interações na rede social.', 'S', 'N', '', '12:09', '2023-11-26', '65050-72', 'São Luís', 'MA', 'Rua Eider Pestana', 123, 'COHAB Anil II');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(25, 3, 'Diagrama Caso de Uso', '', '  ', 'S', 'N', '', '12:11', '2023-11-26', '77420-75', 'Gurupi', 'TO', 'Rua 23', 123, 'Parque Residencial Nova Fronteira');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(26, 3, 'Diagrama de Sequencia Publicação', '', 'Diagrama de Sequencia Publicação\r\nEste diagrama representa a sequência de interações entre o usuário (Usuario), o sistema (Sistema) e o banco de dados\r\n(Banco Dados) durante o processo de criação de uma publicação. Cada seta indica uma mensagem enviada entre os\r\nparticipantes, e as linhas de vida mostram a ativação e desativação dos participantes ao longo do tempo.', 'S', 'N', '', '12:13', '2023-11-26', '92022-08', 'Canoas', 'RS', 'Rua Irlanda', 123, 'Marechal Rondon'),
(27, 3, 'Diagrama de Sequencia Cadastro', '', 'Diagrama de Sequencia Cadastro\r\nEste diagrama de sequência representa a interação entre o usuário (Usuario), o sistema (Sistema) e o banco de dados\r\n(Banco Dados) durante o processo de fazer um cadastro em uma rede social. Cada mensagem entre os participantes é\r\nindicada por uma seta, e as linhas de vida mostram a ativação e desativação dos participantes ao longo do tempo.', 'S', 'S', '1. **Usuário Inicia o Processo:**\r\n- Acessa a tela de cadastro na interface da rede\r\nsocial.\r\n<br/>\r\n2. **Sistema Solicita Informações:**\r\n- Solicita ao usuário as informações necessárias para\r\no cadastro, como nome, email e senha.\r\n<br/>\r\n3. **Usuário Fornece Informações:**\r\n- Preenche os campos obrigatórios com suas\r\ninformações.\r\n<br/>\r\n4. **Verificação de Disponibilidade de Email:**\r\n- O sistema verifica se o email fornecido pelo usuário\r\nestá disponível.\r\n<br/>\r\n- **Sucesso:**\r\n- O email está disponível para cadastro.\r\n<br/>\r\n- **Alternativa:**\r\n- Notifica o usuário se o email já estiver registrado.\r\n<br/>\r\n5. **Criação de Conta no Banco de Dados:**\r\n- Se o email estiver disponível, o sistema cria uma\r\nnova conta associada ao email no banco de dados.\r\n<br/>\r\n6. **Geração de Perfil Padrão:**\r\n- O sistema gera um perfil padrão para o novo\r\nusuário, incluindo configurações iniciais.\r\n<br/>\r\n7. **Confirmação de Cadastro:**\r\n- O sistema exibe uma mensagem de confirmação de\r\ncadastro bem-sucedido.\r\n<br/>\r\n8. **Redirecionamento para Página Inicial:**\r\n- Redireciona o usuário para a página inicial da rede\r\nsocial, pronto para realizar login.', '12:15', '2023-11-26', '59063-10', 'Natal', 'RN', 'Avenida Jerônimo Câmara', 123, 'Lagoa Nova');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(28, 3, 'Diagrama de Sequencia Evento', '', 'Diagrama de Sequencia Evento\r\nO usuário solicita a criação de um evento.\r\nO sistema verifica as permissões do usuário no banco de dados.\r\nSe as permissões são verificadas com sucesso, o sistema cria um novo evento no banco de dados.\r\nEm caso de sucesso, o sistema notifica os participantes do evento através de um serviço de notificação.\r\nSe a notificação for bem-sucedida, o sistema confirma a criação do evento para o usuário.\r\nSe houver uma falha ao criar o evento, o sistema envia uma mensagem de erro para o usuário.', 'S', 'S', '1. **Usuário Inicia o Processo:**\r\n- Acessa a tela de criação de evento.\r\n<br/>\r\n2. **Sistema Solicita Detalhes do Evento:**\r\n- Solicita e usuário fornece informações do evento.\r\n<br/>\r\n3. **Verificação de Permissões:**\r\n- Verifica se o usuário tem permissões para criar\r\neventos.\r\n<br/>\r\n4. **Criação de Evento:**\r\n- Se o usuário tem permissões, o sistema cria o\r\nevento.\r\n<br/>\r\n5. **Notificação de Participantes:**\r\n- Notifica os participantes potenciais.\r\n<br/>\r\n6. **Confirmação e Redirecionamento:**\r\n- Exibe confirmação e redireciona para a página do\r\nevento.', '12:18', '2023-11-26', '59063-10', 'Natal', 'RN', 'Avenida Jerônimo Câmara', 123, 'Lagoa Nova');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(29, 3, 'Diagrama de Sequencia Senha', '', 'Diagrama de Sequencia Senha\r\nO usuário solicita a redefinição de sua senha.\r\nO sistema verifica a existência do email no banco de dados.\r\nSe o email é encontrado, o sistema gera um token de redefinição de senha.\r\nO sistema armazena o token no banco de dados.\r\nO sistema envia um email com instruções de redefinição para o usuário.\r\nO usuário recebe a confirmação da solicitação de redefinição de senha.', 'S', 'S', '1. **Usuário Inicia o Processo:**\r\n- Acessa a tela de recuperação de senha.\r\n<br/>\r\n2. **Sistema Solicita Email:**\r\n- Solicita que o usuário insira o email associado à conta.\r\n<br/>\r\n3. **Usuário Fornece Email:**\r\n- Insere o email e solicita a redefinição de senha.\r\n<br/>\r\n4. **Verificação de Email no Banco de Dados:**\r\n- Verifica a existência do email.\r\n<br/>\r\n- **Sucesso:**\r\n- Gera um token de redefinição associado ao email.\r\n<br/>\r\n- **Alternativa:**\r\n- Notifica se o email não estiver registrado.\r\n<br/>\r\n5. **Envio de Email com Instruções:**\r\n- Envia email contendo instruções e token.\r\n<br/>\r\n- **Sucesso:**\r\n- Exibe mensagem de envio bem-sucedido.\r\n<br/>\r\n- **Alternativa:**\r\n- Exibe mensagem de erro em caso de falha.\r\n<br/>\r\n6. **Usuário Recebe Instruções por Email:**\r\n- Recebe email e decide seguir as instruções.\r\n<br/>\r\n7. **Confirmação de Solicitação pelo Usuário:**\r\n- Aguarda confirmação do usuário.\r\n<br/>\r\n- **Sucesso:**\r\n- Redireciona para página de nova senha.\r\n<br/>\r\n- **Alternativa:**\r\n- Permite nova tentativa.\r\n<br/>\r\n8. **Atualização da Senha:**\r\n- Insere nova senha e confirma atualização.\r\n<br/>\r\n- **Sucesso:**\r\n- Exibe mensagem de confirmação e redireciona para tela\r\nde login.\r\n<br/>\r\n- **Alternativa:**\r\n- Exibe mensagem de erro em caso de falha', '12:21', '2023-11-26', '87053-11', 'Maringá', 'PR', 'Rua Manoel Lopes', 123, 'Conjunto João de Barro I');

